import React from 'react';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
const Home=()=>{
    return(
        <>
      <Grid container  style={{position: 'absolute', top:0}}>
            <Grid item xs={12}>
                <img width="100%" height="60%" src="https://images.unsplash.com/photo-1521587760476-6c12a4b040da?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxzZWFyY2h8NjR8fGxlZ2FsfGVufDB8fDB8&auto=format&fit=crop&w=600&q=60" />
            </Grid>
      </Grid>
        </>
);
}

export default Home;
